records.addlTxt:
Defendant Harry Nyemah in court with attorney Maayan Silver.  James W. Frisch appeared for the State of Wisconsin.  Defendant arrived late (at 10:55 a.m.) and was admonished by the Court.  Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed  90 days at the House of Correction, with Huber for work; good time allowed.  Credit for 3 days time served.  Court STAYED said sentence and placed defendant on probation for one (1) year.
 * Court ordered defendant to pay the DNA surcharge, costs and disbursements while on probation.

CONDITIONS OF PROBATION:
 - No contact with Evelyn M. or Monica L.  or their residences;
 - No contact with the building located at 845 North 26th Street, Milwaukee, Wisconsin;
 - Undergo a mental health evaluation; follow thru with any treatment recommended;
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for his mental or physical needs; take all medications as prescribed and only for as long as deemed necessary for his mental or physical needs;
 - No alcohol;
 - Urine screens;
 - AODA assessment; treatment if needed;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Parenting classes/counseling;
 - Pay the ordered surcharges, costs and disbursements.  Failure to pay all monies at the end of the probationary period would result in a civil judgment entered against defendant.

Should defendant successfully complete all conditions set forth by this court and the Department of Corrections, pay all costs associated with this case and remain free and clear of the criminal justice system arising to the level of probable cause or greater, misdemeanor or felony, court would consider petition for expungement.

